import React, { useState, useEffect, useRef } from 'react';
import './MapAddressSelector.css';

const MapAddressSelector = ({ onAddressSelect, onClose }) => {
  const [map, setMap] = useState(null);
  const [marker, setMarker] = useState(null);
  const [selectedAddress, setSelectedAddress] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const mapRef = useRef(null);

  useEffect(() => {
    // Load Google Maps API
    const loadGoogleMaps = () => {
      if (window.google && window.google.maps) {
        initializeMap();
        return;
      }

      const script = document.createElement('script');
      script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyCHATAMkCfr-KRmodm2qAQE97THhtbiovk`;
      script.async = true;
      script.defer = true;
      script.onload = initializeMap;
      script.onerror = () => {
        console.error('Failed to load Google Maps API');
        setIsLoading(false);
      };
      document.head.appendChild(script);
    };

    loadGoogleMaps();
  }, []);

  const initializeMap = () => {
    if (!mapRef.current) return;

    const defaultLocation = { lat: 40.7128, lng: -74.0060 }; // New York City

    const mapInstance = new window.google.maps.Map(mapRef.current, {
      center: defaultLocation,
      zoom: 13,
      mapTypeControl: false,
      streetViewControl: false,
      fullscreenControl: false,
      styles: [
        {
          featureType: 'poi',
          elementType: 'labels',
          stylers: [{ visibility: 'off' }]
        }
      ]
    });

    const markerInstance = new window.google.maps.Marker({
      position: defaultLocation,
      map: mapInstance,
      draggable: true,
      title: 'Drag to select address'
    });

    // Add click listener to map
    mapInstance.addListener('click', (event) => {
      const position = event.latLng;
      markerInstance.setPosition(position);
      reverseGeocode(position);
    });

    // Add drag listener to marker
    markerInstance.addListener('dragend', (event) => {
      const position = event.latLng;
      reverseGeocode(position);
    });

    setMap(mapInstance);
    setMarker(markerInstance);
    setIsLoading(false);
  };

  const reverseGeocode = (position) => {
    console.log('Attempting reverse geocoding for position:', position.lat(), position.lng());

    const geocoder = new window.google.maps.Geocoder();

    // Add more detailed error logging
    console.log('Geocoder object:', geocoder);
    console.log('Position object:', position);

    geocoder.geocode({ location: position }, (results, status) => {
      console.log('Geocoding status:', status);
      console.log('Geocoding results:', results);
      console.log('Status code meaning:');
      switch(status) {
        case 'OK':
          console.log('‚úÖ OK - Request was successful');
          break;
        case 'ZERO_RESULTS':
          console.log('‚ùå ZERO_RESULTS - No results found');
          break;
        case 'OVER_QUERY_LIMIT':
          console.log('‚ùå OVER_QUERY_LIMIT - Quota exceeded');
          break;
        case 'REQUEST_DENIED':
          console.log('‚ùå REQUEST_DENIED - API key issue');
          break;
        case 'INVALID_REQUEST':
          console.log('‚ùå INVALID_REQUEST - Bad request');
          break;
        default:
          console.log('‚ùì Unknown status:', status);
      }

      if (status === 'OK' && results[0]) {
        const addressComponents = results[0].address_components;
        const formattedAddress = results[0].formatted_address;

        console.log('Formatted address:', formattedAddress);
        console.log('Address components:', addressComponents);

        // Parse address components
        let streetNumber = '';
        let route = '';
        let city = '';
        let state = '';
        let zipCode = '';

        addressComponents.forEach(component => {
          const types = component.types;
          console.log('Component:', component.long_name, 'Types:', types);

          if (types.includes('street_number')) {
            streetNumber = component.long_name;
          } else if (types.includes('route')) {
            route = component.long_name;
          } else if (types.includes('locality')) {
            city = component.long_name;
          } else if (types.includes('administrative_area_level_1')) {
            state = component.short_name;
          } else if (types.includes('postal_code')) {
            zipCode = component.long_name;
          }
        });

        const address = {
          fullAddress: formattedAddress,
          streetAddress: `${streetNumber} ${route}`.trim(),
          city: city,
          state: state,
          zip: zipCode,
          lat: position.lat(),
          lng: position.lng()
        };

        console.log('Parsed address:', address);
        setSelectedAddress(address);
      } else {
        console.log('Reverse geocoding failed. Status:', status);
        console.log('Error details:', results);

        // Try a different approach - use the formatted address directly
        if (results && results[0] && results[0].formatted_address) {
          const address = {
            fullAddress: results[0].formatted_address,
            streetAddress: 'Address from Google',
            city: 'From Google Maps',
            state: 'From Google Maps',
            zip: 'From Google Maps',
            lat: position.lat(),
            lng: position.lng()
          };
          setSelectedAddress(address);
        } else {
          // Fallback to basic coordinates if geocoding fails
          const address = {
            fullAddress: `Location at ${position.lat().toFixed(6)}, ${position.lng().toFixed(6)}`,
            streetAddress: 'Unknown Street',
            city: 'Unknown City',
            state: 'Unknown State',
            zip: 'Unknown ZIP',
            lat: position.lat(),
            lng: position.lng()
          };
          setSelectedAddress(address);
        }
      }
    });
  };

  const handleConfirmAddress = () => {
    if (selectedAddress) {
      onAddressSelect(selectedAddress);
    }
  };

  const handleSearchLocation = (searchQuery) => {
    if (!map || !searchQuery.trim()) return;

    console.log('Searching for address:', searchQuery);
    const geocoder = new window.google.maps.Geocoder();

    geocoder.geocode({ address: searchQuery }, (results, status) => {
      console.log('Search geocoding status:', status);
      console.log('Search results:', results);

      if (status === 'OK' && results[0]) {
        const position = results[0].geometry.location;
        console.log('Found position:', position.lat(), position.lng());
        map.setCenter(position);
        map.setZoom(16);
        marker.setPosition(position);
        reverseGeocode(position);
      } else {
        console.log('Geocoding failed for:', searchQuery, 'Status:', status);
        console.log('Error details:', results);
        // Show user-friendly error message
        alert(`Could not find address: "${searchQuery}". Please try a different search term.`);
      }
    });
  };

  return (
    <div className="map-address-selector">
      <div className="map-header">
        <h3>Select Address from Map</h3>
        <button className="close-button" onClick={onClose}>‚úï</button>
      </div>

      <div className="search-container">
        <input
          type="text"
          placeholder="Search for an address..."
          className="address-search"
          onKeyPress={(e) => {
            if (e.key === 'Enter') {
              handleSearchLocation(e.target.value);
            }
          }}
        />
        <button 
          className="search-button"
          onClick={() => {
            const input = document.querySelector('.address-search');
            handleSearchLocation(input.value);
          }}
        >
          üîç
        </button>
      </div>

      <div className="map-container">
        {isLoading && (
          <div className="map-loading">
            <div className="loading-spinner"></div>
            <p>Loading map...</p>
          </div>
        )}
        <div ref={mapRef} className="google-map"></div>
      </div>

      {selectedAddress && (
        <div className="selected-address">
          <h4>Selected Address:</h4>
          <p>{selectedAddress.fullAddress}</p>
          <div className="address-details">
            <span><strong>Street:</strong> {selectedAddress.streetAddress}</span>
            <span><strong>City:</strong> {selectedAddress.city}</span>
            <span><strong>State:</strong> {selectedAddress.state}</span>
            <span><strong>ZIP:</strong> {selectedAddress.zip}</span>
          </div>
        </div>
      )}

      <div className="map-actions">
        <button 
          className="cancel-button" 
          onClick={onClose}
        >
          Cancel
        </button>
        <button 
          className="confirm-button" 
          onClick={handleConfirmAddress}
          disabled={!selectedAddress}
        >
          Confirm Address
        </button>
      </div>
    </div>
  );
};

export default MapAddressSelector;
